import logo from './logo.svg';
import './App.css';
import { Button, Checkbox } from '@mui/material';
import { createTheme, ThemeProvider, styled,} from '@mui/material/styles';
import { Grid } from '@mui/material';
import { Typography } from '@mui/material';
import { purple, green } from '@mui/material/colors';
import { Box } from '@mui/system';

const theme = createTheme({
  palette: {
    primary: {
      main: "#170D05",
      light: "#84847C"
    },
    secondary: {
      main: "#D5761D",
      light: "#827C74"
    },
  },
  typography: {
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
  },
});

function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <link
          rel="stylesheet"
          href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
        />
        <header className="App-header">
          <Grid container alignItems="center" justifyContent="center" >
            <Grid item xs={12}>
              <Typography variant="h1" sx={{paddingBottom:2}}>
                Northumbria Vikings
              </Typography>
            </Grid>
            <Grid item xs={8}>
              <Box sx={{backgroundColor:"primary.main", paddingTop:2, paddingBottom:2}}>
                <Typography>
                  Box 1
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={4}>
            <Box sx={{backgroundColor:"secondary.main", paddingTop:2, paddingBottom:2}}>
                <Typography>
                  Box 2
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={3}>
            <Box sx={{backgroundColor:"secondary.main.dark", paddingTop:2, paddingBottom:2}}>
                <Typography>
                  Box 3
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={9}>
            <Box sx={{backgroundColor:"secondary.main.dark", paddingTop:2, paddingBottom:2}}>
                <Typography>
                  Box 4
                </Typography>
              </Box>
            </Grid>
          </Grid>
        </header>
      </ThemeProvider>
    </div>
  );
}

export default App;
